import React from "react";
import "./Certificates.css";
import logo from "../../images/certifications.png";

const Certificates = () => {
  return (
    <>
      <div className="certificatesContainer">
        <div className="images">
          <img src={logo} alt="logo1" />
        </div>
      </div>
      ;
    </>
  );
};

export default Certificates;
